import"./chunk-JS3ZFT6L.js";var s="Coalescer",o="Fundado em 2023 pela dupla de arquitetos Marta Gouveia e Tonny Marques, unidos pela pr\xE1tica da arquitetura em diferentes contextos insulares (A\xE7ores e Madeira). Atrav\xE9s de imagin\xE1rios, pesquisas de mem\xF3rias, leituras de territ\xF3rios distintos e experi\xEAncias individuais adquiridas, procuram inspira\xE7\xE3o para assim criar um \xFAnico corpo, arquitetura. Esta leitura tem-se materializado pela cole\xE7\xE3o de uma s\xE9rie de registos de geografias que servem de suporte para o nosso dia a dia e sinopse desses olhares que apresentamos em desenhos, imagens, colagens e maquetes de diferentes escalas denunciam uma posi\xE7\xE3o ou uma atitude de projeto que nos parece coerente e sincera perante o lugar. Numa escala mais ampla por meio de atividades acad\xE9micas colecionamos os trabalhos de curso de arquitetura, ambos pela Universidade de \xC9vora entre 2017 e 2024, a disserta\xE7\xE3o de Marta Gouveia \u201CO que pode ser uma ilha\u201D de S\xE3o Miguel vencedora do pr\xE9mio Archiprix 2025 e a disserta\xE7\xE3o de Tonny Marques \u201CImagin\xE1rio pitoresco, C\xE2mara de Lobos\u201D na Ilha da Madeira, vencedor da men\xE7\xE3o honrosa do pr\xE9mio Archiprix 2025, duas leituras de territ\xF3rios distintos que nos transmitem diferentes atmosferas dos diferentes lugares.",r="Morada",i="Rua Gon\xE7alo Velho n\xBA 6",d="9680-156 Vila Franca Do Campo",t="Ilha de S\xE3o Miguel, A\xE7ores",n="Equipa",u="Contacto",m={LINE_1:"Design e desenvolvimento do site por, {{name}}",LINE_2:"Imagens protegidas por direitos autorais \xA9COALESCER.",LINE_3:"Todos os direitos pertencem aos respetivos autores."},p={COALESCER:s,DESCRIPTION:o,ADRESS_LABEL:r,ADRESS_1:i,ADRESS_2:d,ADRESS_3:t,TEAM_LABEL:n,CONTACT_LABEL:u,CREDITS:m};export{i as ADRESS_1,d as ADRESS_2,t as ADRESS_3,r as ADRESS_LABEL,s as COALESCER,u as CONTACT_LABEL,m as CREDITS,o as DESCRIPTION,n as TEAM_LABEL,p as default};
